import React from "react";
import Data from "../Data";

const Gallery = () => {
  return (
    <>
      <section className="collection">
        <div className="container top">
            {Data.map((value) => {
                return (
                    <dv></dv>
                )
            })}
        </div>
      </section>
    </>
  );
};

export default Gallery;
